import React from 'react'
import { Link } from 'react-router-dom'
import './HelloBox.css';

function HelloBox() {
    return (
        <>
            <h1>Hello!</h1>
            <figure classname='hello__box'>
            </figure>
        </>
    )
}

export default HelloBox;
